import { Link } from "react-router-dom";
import "./_Header.scss";

function Header() {
  return (
    <header className="header">
      <nav>
        <Link to="/">Accueil</Link>
        <Link to="/About">A propos</Link>
      </nav>
    </header>
  );
}

export default Header;
